Raríssimo em pdf 👉 "Os donos do mundo" 

Nesta obra pioneira sobre o Clube Bilderberg, fruto de exaustivas investigações e análises, Cristina Jiménez traz à tona os dados sobre a organização que, por meio do controle da mídia, do dinheiro e da influência política, coordena os rumos do mundo.

@comhecimentoproibido

*Stress total:  Estamos no bico do funil. FFAA entrarão no Campo em qualquer madrugada.*

*1 -* Pr. Bolsonaro não saiu do Alvorada e não vai passar a Faixa para o  carniça;

*2 -* Paulo Guedes tirou férias e não desocupou a Granja do Torto;

*3 -* Ministro da Defesa recebeu o Chuchu apenas por cortesia, 15 minutos;

*4 -* Vice-presidente General Mourão tb recebeu o Chuchu apenas por cortesia;

*5 -* General Braga Netto, Vice-presidente eleito com Bolsonaro fez uma viagem para os USA, encontros com chefes das FFAA dos USA. *Ninguém sabe onde  está o General Braga Netto*;

*5 - General Heleno tb sumiu;*

*6 -* Comandantes do Exército, Marinha e Aeronáutica, absolutamente calados;

*7 -*  Zé Dirceu viajou de férias para Cuba e curiosamente *NÃO retornou para o Brasil*;

*8 -* Os Decretos e Portarias publicadas no DOU referem-se a Equipamentos Militares, Tanques de Guerra , Drones,  Munições, Helicópteros, Material Radioativo para Submarino Nuclear, etc.
Três toneladas de Acetona para fabricação de explosivos. Tudo já está no Brasil pronto para uso;

*9 -* Aparentemente as últimas movimentações de tropas, blindados e etc aconteceram no último dia 17/12;

*10 -* Aquele Avião de transporte do governo russo com escala no Irã e destino à Brasília, *ninguém sabe o conteúdo do avião*;

*11 -* Navios de guerra do Qatar visitando o Brasil, inclusive tudo indica que o Emir do Qatar fará uma visita à BRASÍLIA;

*12 -* O Emir do Qatar pousou no Galeão em seu Avião 747 - Air Force One e mais dois aviões 747. *Ninguém sabe o conteúdo desses outros dois aviões 747.* Aviões 747 são enormes;

*13 -* Silêncio ensurdecedor do Pr. Bolsonaro e das FFAA;

*14 -* Biden, Putin, Macron, Primeiros Ministros da Inglaterra, Alemanha, Itália, Espanha, Índia, etc.. *NÃO virão para "Posse do carniça"*;

*15 -* Pessoas Convidadas para o governo do carniça saindo pela tangente;

*16 -* Único falante é o comunista ladrão, ex-governador do Maranhão que deixou um rombo de R$ 1 bilhão em oito anos de governo;

*17 -* Deputados, senadores do PT, PSB, PDT, PCdoB e esquerda em geral, *calados*.

*18 -* Governadores da Esquerdalha Podre *em silêncio*;

*19 -* Nine a 5 dias da posse: o normal seria todos muito felizes, sorridentes, tagarelando, dando entrevistas para todos os lados, etc... Divulgando  300 mil poiadores presentes na cerimônia de posse do elemento... *mas não*;

*20 -* A maioria dos urubus estão calados, alguns há bastante tempo;

*21 -* Enigmas, postagens, etc... Sinalizando para  o POVO;

*22 -* Mídia internacional publicando _"Brazil was stollen"_;

🤔 *Imaginar que nada vai acontecer???*


*Veremos...*
*Qualquer uma das próximas madrugadas de 28/12 até dia 1° de Janeiro, estão valendo.*
